import { Movie } from './movies';
import { useState } from 'react';

function MovieList() {
    const [movieData, setMovieData] = useState<Movie[]>([]);

    const fetchMovies = async () => {
        const response = await fetch('https://localhost:4000/movie');
        const data = await response.json();
        setMovieData(data);
    };

    fetchMovies();

    return (
        <>
            <div className="row">
                <h4>The best movies!</h4>
            </div>
            <table className="table table-bordered">
                <thead>
                    <tr>
                        <th>Movie ID</th>
                        <th>Title</th>
                        <th>Year</th>
                        <th>Genre</th>
                        <th>Director</th>
                        <th>Rating</th>
                        <th>Edited</th>
                        <th>Lent To</th>
                        <th>Notes</th>
                    </tr>
                </thead>
                <tbody>
                    {movieData.map((movie) => (
                        <tr key={movie.movieId}>
                            <td>{movie.movieId}</td>
                            <td>{movie.title}</td>
                            <td>{movie.year}</td>
                            <td>{movie.category}</td>
                            <td>{movie.director}</td>
                            <td>{movie.rating}</td>
                            <td>{movie.edited}</td>
                            <td>{movie.lentTo}</td>
                            <td>{movie.notes}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </>
    );
}

export default MovieList;
